import { makeStyles } from "@material-ui/core/styles";

const NavBarMakeStyle = makeStyles((theme) => ({
  AppBar: {
    backgroundColor: "#ffff",
  },
  logo: {
    marginLeft: 30,
  },
  Tabs: {
    marginLeft: "auto",
    fontFamily: "Roboto",
    paddinRight: "30px",
  },

  tabItems: {
    color: "#5d89a2",
    textTransform: "upperCase",
    fontWeight: "300",
    fontSize: "0.95em",
    minWidth: 5,
    marginLeft: "15px",
  },
}));

export default NavBarMakeStyle;
